import React from 'react';
import {Switch, Route } from 'react-router-dom';
import routeCollection from './router/route.const';

import DefaultLayout from './layouts/Default';
import AfterLoginLayout from './layouts/AfterLogin';

const RouteLayer = ()=>{
  let routeDisplayCollection = routeCollection.map((route,i)=>{
    switch(route.layout) {
      case 'DefaultLayout':
      return <DefaultLayout key={this.context.router.getCurrentPath()} exact path={route.path} component={route.component}/>
      case 'AfterLoginLayout':
      return <AfterLoginLayout key={this.context.router.getCurrentPath()} path={route.path} component={route.component}/>
    }
  });
  return (
    <Switch>
      {routeDisplayCollection}
    </Switch>
  )
}
export default RouteLayer;
